import "./MainContentStyles/MainContent.scss";
import star from "./MainContentStyles/star.png";
function MainContent(props) {
  console.log(Math.round(props.price_24h * 10) / 10);
  return (
    <div className="mainContent">
      <div className="cont1">
        <p>{props.index}</p>
        <img src={star} alt="" width="10%" height="100%" />
      </div>

      <div className="cont2">
        <img src={props.img} alt="" />
        <p>{props.name}</p>
      </div>
      <div className="cont3">{props.symbol}</div>
      <div className="cont4">${props.current_price}</div>
      <div className="cont5" style={{color: ( Math.round(props.price_24h *10/10)) >= 0 ? 'red':'green'}}>
        {Math.round((props.price_24h / 24) * 10) / 10}
      </div>
      <div className="cont6">{Math.round(props.price_24h * 10) / 10}%</div>
      <div className="cont7">{Math.round(props.price_7days * 10) / 10}%</div>
      <div className="cont8">${props.total_volume}</div>
      <div className="cont9">${props.mkt_cap}</div>
      <div className="cont10">{props.mkt_cap_24h}</div>
    </div>
  );
}

export default MainContent;
